      "sp.key.gdpr": "{\"applies\":true,\"message\":{\"categories\":[{\"_id\":\"608bad95d08d3112188e0e29\",\"description\":\"Cookies, device or similar online identifiers (e.g. login-based identifiers, randomly assigned identifiers, network based identifiers) together with other information (e.g. browser type and information, language, screen size, supported technologies etc.) can be stored or read on your device to recognise it each time it connects to an app or to a website, for one or several of the purposes presented here. \",\"name\":\"Store and\\/or access information on a device\",\"type\":\"IAB_PURPOSE\"},{\"_id\":\"608bad95d08d3112188e0e2f\",\"description\":\"Advertising presented to you on this service can be based on limited data, such as the website or app you are using, your non-precise location, your device type or which content you are (or have been) interacting with (for example, to limit the number of times an ad is presented to you).\",\"name\":\"Use limited data to select advertising\",\"type\":\"IAB_PURPOSE\"},{\"_id\":\"608bad95d08d3112188e0e36\",\"description\":\"Information about your activity on this service (such as forms you submit, content you look at) can be stored and combined with other information about you (for example, information from your previous activity on this service and other websites or apps) or similar users. This is then used to build or improve a profile about you (that might include possible interests and personal aspects). Your profile can be used (also later) to present advertising that appears more relevant based on your possible interests by this and other entities.\",\"name\":\"Create profiles for personalised advertising\",\"type\":\"IAB_PURPOSE\"},{\"_id\":\"608bad95d08d3112188e0e3d\",\"description\":\"Advertising presented to you on this service can be based on your advertising profiles, which can reflect your activity on this service or other websites or apps (like the forms you submit, content you look at), possible interests and personal aspects.\",\"name\":\"Use profiles to select personalised advertising\",\"type\":\"IAB_PURPOSE\"},{\"_id\":\"608bad96d08d3112188e0e4d\",\"description\":\"Information regarding which advertising is presented to you and how you interact with it can be used to determine how well an advert has worked for you or other users and whether the goals of the advertising were reached. For instance, whether you saw an ad, whether you clicked on it, whether it led you to buy a product or visit a website, etc. This is very helpful to understand the relevance of advertising campaigns.\",\"name\":\"Measure advertising performance\",\"type\":\"IAB_PURPOSE\"},{\"_id\":\"608bad96d08d3112188e0e59\",\"description\":\"Reports can be generated based on the combination of data sets (like user profiles, statistics, market research, analytics data) regarding your interactions and those of other users with advertising or (non-advertising) content to identify common characteristics (for instance, to determine which target audiences are more receptive to an ad campaign or to certain contents).\",\"name\":\"Understand audiences through statistics or combinations of data from different sources\",\"type\":\"IAB_PURPOSE\"},{\"_id\":\"608bad96d08d3112188e0e5f\",\"description\":\"Information about your activity on this service, such as your interaction with ads or content, can be very helpful to improve products and services and to build new products and services based on user interactions, the type of audience, etc. This specific purpose does not include the development or improvement of user profiles and identifiers.\",\"name\":\"Develop and improve services\",\"type\":\"IAB_PURPOSE\"},{\"_id\":\"60b65857619abe242bed971e\",\"description\":\"<p>It's a custom purpose\\/category for demo.<\\/p>\",\"hasConsent\":true,\"hasLegInt\":false,\"name\":\"Our Custom Purpose\",\"type\":\"CUSTOM\"},{\"_id\":\"5e37fc3d973acf1e955b895d\",\"description\":\"Your data can be used to monitor for and prevent unusual and possibly fraudulent activity (for example, regarding advertising, ad clicks by bots), and ensure systems and processes work properly and securely. It can also be used to correct any problems you, the publisher or the advertiser may encounter in the delivery of content and ads and in your interaction with them.\",\"name\":\"Ensure security, prevent and detect fraud, and fix errors\\n\"},{\"_id\":\"5e37fc3d973acf1e955b895e\",\"description\":\"Certain information (like an IP address or device capabilities) is used to ensure the technical compatibility of the content or advertising, and to facilitate the transmission of the content or ad to your device.\",\"name\":\"Deliver and present advertising and content\"},{\"_id\":\"5e37fc3e973acf1e955b8965\",\"description\":\"Information about your activity on this service may be matched and combined with other information relating to you and originating from various sources (for instance your activity on a separate online service, your use of a loyalty card in-store, or your answers to a survey), in support of the purposes explained in this notice.\",\"name\":\"Match and combine data from other data sources\"},{\"_id\":\"5e37fc3e973acf1e955b8964\",\"description\":\"In support of the purposes explained in this notice, your device might be considered as likely linked to other devices that belong to you or your household (for instance because you are logged in to the same service on both your phone and your computer, or because you may use the same Internet connection on both devices).\",\"name\":\"Link different devices\"},{\"_id\":\"5e37fc3e973acf1e955b8963\",\"description\":\"Your device might be distinguished from other devices based on information it automatically sends when accessing the Internet (for instance, the IP address of your Internet connection or the type of browser you are using) in support of the purposes exposed in this notice.\",\"name\":\"Identify devices based on information transmitted automatically\"}],\"language\":\"EN\",\"message_choice\":[{\"button_text\":\"Dismiss\",\"choice_id\":9693846,\"iframe_url\":null,\"type\":15},{\"button_text\":\"1619766996522\",\"choice_id\":9693847,\"iframe_url\":\"https:\\/\\/notice.sp-prod.net\\/privacy-manager\\/index.html?message_id=488393\",\"type\":12},{\"button_text\":\"1619767038123\",\"choice_id\":9693848,\"iframe_url\":null,\"type\":13},{\"button_text\":\"1619767045875\",\"choice_id\":9693849,\"iframe_url\":null,\"type\":11}],\"message_json\":{\"message_json_string\":\"{\\\"type\\\":\\\"Notice\\\",\\\"name\\\":\\\"GDPR Message\\\",\\\"settings\\\":{\\\"selected_privacy_manager\\\":{\\\"type\\\":12,\\\"data\\\":{\\\"button_text\\\":\\\"1619766959808\\\",\\\"privacy_manager_iframe_url\\\":\\\"https:\\/\\/notice.sp-prod.net\\/privacy-manager\\/index.html?message_id=488393\\\",\\\"consent_origin\\\":\\\"https:\\/\\/sourcepoint.mgr.consensu.org\\/tcfv2\\\"}},\\\"languages\\\":{\\\"EN\\\":{\\\"iframeTitle\\\":\\\"<p>GDPR MEssage<\\/p>\\\"},\\\"ES\\\":{\\\"iframeTitle\\\":\\\"<p>Mensaje GDPR<\\/p>\\\"}},\\\"iframeTitle\\\":\\\"<p>GDPR MEssage<\\/p>\\\",\\\"supportedLanguages\\\":[\\\"EN\\\",\\\"ES\\\"],\\\"selectedLanguage\\\":\\\"EN\\\"},\\\"children\\\":[{\\\"type\\\":\\\"Text\\\",\\\"name\\\":\\\"Text\\\",\\\"settings\\\":{\\\"languages\\\":{\\\"EN\\\":{\\\"text\\\":\\\"<p>GDPR Message<\\/p>\\\"},\\\"ES\\\":{\\\"text\\\":\\\"<p>Mensaje GDPR<\\/p>\\\"}},\\\"text\\\":\\\"<p>GDPR Message<\\/p>\\\",\\\"font\\\":{\\\"fontSize\\\":24,\\\"fontWeight\\\":\\\"400\\\",\\\"color\\\":\\\"#000000\\\",\\\"fontFamily\\\":\\\"arial, helvetica, sans-serif\\\"},\\\"selectedLanguage\\\":\\\"ES\\\"},\\\"children\\\":[]},{\\\"type\\\":\\\"Button\\\",\\\"name\\\":\\\"Button\\\",\\\"settings\\\":{\\\"languages\\\":{\\\"EN\\\":{\\\"text\\\":\\\"Show Options\\\"}},\\\"text\\\":\\\"Show Options\\\",\\\"choice_option\\\":{\\\"type\\\":12,\\\"data\\\":{\\\"button_text\\\":\\\"1619766996522\\\",\\\"privacy_manager_iframe_url\\\":